import React from "react";
import "./reports.styles.css";

export const Reports = () => {
  return (
    <div className="reports-main-container">
      <header className="reports-header">Business Reports</header>
      <div className="allreps"></div>
      <div className="report-container sales-reports-container">
        <header className="header-rep">SALES</header>
        <span className="rep-btn">TOTAL SALES</span>
        <span className="rep-btn">LAST 30 DAYS</span>
        <span className="rep-btn">LAST THIS YEAR</span>
        <span className="rep-btn">CUSTOM REPORT</span>
      </div>

      <div className="report-container bills-reports-container"></div>
      <div className="report-container taxes-reports-container"></div>
    </div>
  );
};
